import React from 'react';
import './prestations.css';
import Card from '../Prestations/card/card';

function Prestations() {
  const cardsData = [
    {
      title: "Produit 1",
      imageUrl: "url_de_l_image_1.jpg",
      detailLink: "/produit1",
      price: "$99.99",
    },
    {
      title: "Produit 2",
      imageUrl: "url_de_l_image_2.jpg",
      detailLink: "/produit2",
      price: "$79.99",
    },
    {
        title: "Produit 3",
        imageUrl: "url_de_l_image_2.jpg",
        detailLink: "/produit2",
        price: "$79.99",
      },
      {
        title: "Produit 4",
        imageUrl: "url_de_l_image_2.jpg",
        detailLink: "/produit2",
        price: "$79.99",
      },
      {
        title: "Produit 5",
        imageUrl: "url_de_l_image_2.jpg",
        detailLink: "/produit2",
        price: "$79.99",
      },
    // Ajoutez plus de données de carte ici
  ];

  

  return (
    <div>
      <div className='mt-16 text-center text-5xl sm:text-7xl font-signikaSemiBold'>Mes prestations</div>
      <div className="sm:flex sm:flex-row sm:mt-40 sm:ml-28 sm:mr-28 text-center mt-36 space-y-28 sm:space-x-24  sm:space-y-0 ml-10 mr-10">
        <div className="w-full sm:w-1/2 flex flex-col"><Card {...cardsData[0]} /></div>
        <div className="w-full sm:w-1/2 flex flex-col"><Card {...cardsData[1]} /> </div>
        <div className="w-full sm:w-1/2 flex flex-col"><Card {...cardsData[2]} /></div>
        <div className="w-full sm:w-1/2 flex flex-col"><Card {...cardsData[3]} /></div>
        <div className="w-full sm:w-1/2 flex flex-col"><Card {...cardsData[4]} /></div>
      </div>
    </div>
  );
}

export default Prestations;
